import React from "react";
import "../styles/Home.css"; // Import CSS file
import WallPaper from "../images/wallpaper.png";
import { useNavigate } from "react-router-dom";

export default function Home() {
    const navigate = useNavigate();

    function GameJoin() {
        navigate('/join');
    }

    return (
        <div className="container text-center bg-image" 
           style={{ backgroundImage: `url(${WallPaper})`, height: "100vh" }}>
            {/* <div>
                <h1 className="title">CLUEDO</h1>
            </div> */}
            <img className="img-fluid rounded shadow-sm" src={WallPaper} alt="WallPaper" />
            <button onClick={GameJoin} type="button" className="btn btn-outline-secondary my-2">Start Game</button>
            <footer className="text-body-secondary text-center text-small mt-md-5">
                <p className="mb-1">© 2023–2024 GameJHU</p>
            </footer>
        </div>
    );
}
